// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "./CommissionManager.sol";

contract PropertyMarketplace {

  enum State {
    Purchased,
    Activated,
    Deactivated
  }

  struct Propertie {
    uint id;
    uint price;
    bytes32 proof;
    address owner;
    State state;
  }

  mapping(bytes32 => Propertie) private ownedPropiedad;
  mapping(uint => bytes32) private ownedPropiedadHash;

  uint private totalOwnedPropiedad;
  address private platformOwner;
  CommissionManager private commissionManager;

  // Eventos para depuración
  event PropertiePurchased(bytes32 indexed propertyHash, uint id, uint price, address owner, State state);
  event PropertieCreated(bytes32 indexed propertyHash, uint id, uint price, bytes32 proof, address owner, State state);
  event PropertieCountUpdated(uint totalOwnedPropiedad);
  event PropertieTransferred(bytes32 indexed propertyHash, address from, address to);

  constructor(address _commissionManager) {
    platformOwner = msg.sender;
    commissionManager = CommissionManager(_commissionManager);
  }

  function createProperty(uint price, bytes32 proof) external returns(bytes32) {
    bytes32 propertyHash = keccak256(abi.encodePacked(proof, msg.sender));

    uint id = totalOwnedPropiedad++;
    ownedPropiedad[propertyHash] = Propertie({
      id: id,
      price: price,
      proof: proof,
      owner: msg.sender,
      state: State.Activated
    });

    ownedPropiedadHash[id] = propertyHash;

    emit PropertieCreated(propertyHash, id, price, proof, msg.sender, State.Activated);
    emit PropertieCountUpdated(totalOwnedPropiedad);

    return propertyHash;
  }

  function comprarPropiedad(bytes32 propertyHash, address promoter) external payable {
    Propertie storage propiedad = ownedPropiedad[propertyHash];
    require(propiedad.state == State.Activated, "Property is not for sale");
    require(msg.value == propiedad.price, "Incorrect value");

    uint platformCommissionPercentage = commissionManager.getPlatformCommission();
    uint promoterCommissionPercentage = commissionManager.getPromoterCommission();
    address platformAddress = commissionManager.platformAddress();
    address promoterAddress = commissionManager.promoterAddress();

    uint totalCommission = (msg.value * platformCommissionPercentage) / 100;
    uint promoterCommission = (totalCommission * promoterCommissionPercentage) / 100;
    uint platformCommission = totalCommission - promoterCommission;
    uint priceAfterCommission = msg.value - totalCommission;

    if (promoter != address(0)) {
        payable(promoterAddress).transfer(promoterCommission);
    }
    payable(platformAddress).transfer(platformCommission);
    payable(propiedad.owner).transfer(priceAfterCommission);

    propiedad.owner = msg.sender;
    propiedad.state = State.Purchased;

    emit PropertiePurchased(propertyHash, propiedad.id, propiedad.price, msg.sender, State.Purchased);
  }

  function transferirPropiedad(bytes32 propertyHash, address to) external {
    require(to != address(0), "La direccion de destino no puede ser cero");

    Propertie storage propiedad = ownedPropiedad[propertyHash];
    require(propiedad.owner == msg.sender, "Solo el owner puede transferir la propiedad");

    propiedad.owner = to;

    emit PropertieTransferred(propertyHash, msg.sender, to);
  }

  function getPropertieCount() external view returns (uint) {
    return totalOwnedPropiedad;
  }

  function getPropertieHashAtIndex(uint index) external view returns (bytes32) {
    return ownedPropiedadHash[index];
  }

  function getPropertieByHash(bytes32 propertyHash) external view returns (Propertie memory) {
    return ownedPropiedad[propertyHash];
  }
}
